import React from "react";
import TextLoop from "react-text-loop";
import { makeStyles } from '@material-ui/core/styles';
import FormLabel from '@material-ui/core/FormLabel';
import FormControl from '@material-ui/core/FormControl';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import Checkbox from '@material-ui/core/Checkbox';

// import '../styles/main.scss'
import { Container, Row, Col, Button } from "react-bootstrap"

export default () => {

  return (
    <div className="component second-component">
      <Container className="center-block" style={{ alignSelf: 'center', }}>
        < Col style={{ marginBottom: '50px' }}>
          <h3>รายการสินค้าเพื่อสุขภาพและความปลอดภัยสำหรับตัวคุณ</h3>
        </Col >
        <Col >
          <Form style={{ width: '600px' }} className="center-block" onSubmit={handleSubmit(onSubmit)}>
            <div key='default-checkbox' className="mb-3">
              <Form.Check size="lg" inline label="ไข่ไก่" type='checkbox' id='default-checkbox-1' />
              <Form.Check inline label="2" type='checkbox' id='default-checkbox-2' />
              <Form.Check inline label="3" type='checkbox' id='default-checkbox-3' />
            </div>
          </Form>
        </Col>
      </Container>
    </div>
  );
};
